import Card from "../UI/Card";
const ListUser = (props) => {
  return (
    <Card>
    <ul>
      {props.list.map((user) => (
        <li>
          {user.name} ({user.age} years old)
        </li>
      ))}
    </ul>
    </Card>
  );
};

export default ListUser;
